import React from 'react';
import {
  View,
  Text,
  StyleSheet,
  Dimensions,
  Platform
} from 'react-native';

const { width } = Dimensions.get('window');

const ValuePropositionSection = () => {
  return (
    <View style={styles.container}>
      <View style={styles.content}>
        <Text style={styles.statement}>
          I recently turned down $10,000 from an aspiring founder. His idea already existed in the market with no clear differentiator. I could have taken his money - he was non-technical and wouldn't have known better.
        </Text>

        <Text style={styles.principle}>
          But I answer to a higher power.
        </Text>

        <Text style={styles.philosophy}>
          When you succeed, I succeed. I take equity in every venture I build. Traditional agencies bill hourly and build anything. I validate ruthlessly and only build what will win.
        </Text>

        <View style={styles.differentiators}>
          <View style={styles.comparison}>
            <View style={styles.comparisonColumn}>
              <Text style={styles.columnTitle}>Traditional Agencies</Text>
              <Text style={styles.comparisonItem}>✗ Bill by the hour</Text>
              <Text style={styles.comparisonItem}>✗ Build anything for money</Text>
              <Text style={styles.comparisonItem}>✗ 6+ months timeline</Text>
              <Text style={styles.comparisonItem}>✗ No skin in the game</Text>
              <Text style={styles.comparisonItem}>✗ $75k-150k upfront</Text>
            </View>

            <View style={styles.divider} />

            <View style={styles.comparisonColumn}>
              <Text style={styles.columnTitle}>My Approach</Text>
              <Text style={[styles.comparisonItem, styles.positive]}>✓ Equity partnership</Text>
              <Text style={[styles.comparisonItem, styles.positive]}>✓ Only build winners</Text>
              <Text style={[styles.comparisonItem, styles.positive]}>✓ 2-12 weeks with AI</Text>
              <Text style={[styles.comparisonItem, styles.positive]}>✓ Success aligned</Text>
              <Text style={[styles.comparisonItem, styles.positive]}>✓ Flexible deal structures</Text>
            </View>
          </View>
        </View>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: '#0A0B0F',
    paddingVertical: 80,
    paddingHorizontal: width > 768 ? 40 : 20,
    borderTopWidth: 1,
    borderTopColor: 'rgba(255, 255, 255, 0.06)',
  },
  content: {
    maxWidth: 900,
    alignSelf: 'center',
    width: '100%',
  },
  statement: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 20 : 17,
    color: '#E5E5E5',
    lineHeight: width > 768 ? 32 : 28,
    marginBottom: 24,
    textAlign: 'center',
  },
  principle: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 24 : 20,
    color: '#F59E0B',
    fontWeight: '700',
    textAlign: 'center',
    marginBottom: 24,
    letterSpacing: -0.5,
  },
  philosophy: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 20 : 17,
    color: '#E5E5E5',
    lineHeight: width > 768 ? 32 : 28,
    textAlign: 'center',
    marginBottom: 48,
  },
  differentiators: {
    marginTop: 40,
  },
  comparison: {
    flexDirection: width > 768 ? 'row' : 'column',
    justifyContent: 'center',
    alignItems: width > 768 ? 'flex-start' : 'center',
    gap: width > 768 ? 60 : 40,
    backgroundColor: 'rgba(20, 21, 32, 0.5)',
    padding: width > 768 ? 40 : 24,
    borderRadius: 16,
    borderWidth: 1,
    borderColor: 'rgba(255, 255, 255, 0.06)',
  },
  comparisonColumn: {
    flex: width > 768 ? 1 : 0,
    maxWidth: 300,
    width: '100%',
  },
  columnTitle: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 20 : 18,
    fontWeight: '700',
    color: '#FFFFFF',
    marginBottom: 20,
    textAlign: width > 768 ? 'left' : 'center',
  },
  comparisonItem: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 16 : 15,
    color: '#9CA3AF',
    marginBottom: 12,
    textAlign: width > 768 ? 'left' : 'center',
  },
  positive: {
    color: '#0EA5E9',
  },
  divider: {
    width: width > 768 ? 1 : '80%',
    height: width > 768 ? 'auto' : 1,
    backgroundColor: 'rgba(255, 255, 255, 0.1)',
    alignSelf: 'stretch',
  },
});

export default ValuePropositionSection;
